CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_autoUser` (`_txtJson` JSON)  BEGIN
	#CREATE PROCEDURE sp_autoUser(_txtJson JSON)
    SET @email=REPLACE(JSON_EXTRACT(_txtJson , '$.email'),'"','');
    SET @pass=REPLACE(JSON_EXTRACT(_txtJson , '$.pass'),'"','');
    SET @sec=REPLACE(JSON_EXTRACT(_txtJson , '$.sec'),'"','');
    SET @id_app=REPLACE(JSON_EXTRACT(_txtJson , '$.id_app'),'"','');
	SET @key=fn_crearKey(@pass);
  
    SET @qry=IFNULL((
		SELECT CONCAT('{"id_per":',T1.id_per
			   ,',"nom":"',T1.nom,'","id_user":',T1.id_user
			  ,',"id_app":',T2.id_app,',"descr":"',T2.descr,'"'
			  ,',"sec":',JSON_EXTRACT(T2.permisos,CONCAT('$[',@sec,']')),'}')
		FROM(
			SELECT id_per,nom,id_user,id_app
			FROM sop_per_u 
			WHERE email=@email AND pass=@key AND estado=1 and id_app=@id_app
        ) AS T1
		LEFT JOIN(
			select *
			from sop_usu_u
		)AS T2
		ON T1.id_user=T2.id_usu AND T1.id_app=T2.id_app
		),'{}')
    ;
   
    IF @qry<>'{}' THEN
		SET @hoy=DATE_FORMAT(NOW(), '%d/%m/%Y');
		SET @id=(SELECT id_per
				FROM sop_per_u
				WHERE email=@email AND pass=@key AND estado=1 and id_app=@id_app
		);
		SET @token=fn_crearKey( CONCAT(@hoy,@id,'omega') );
    ELSE
		SET @token='';
    END IF;
    
    SELECT CONCAT('{"error":',(CASE WHEN @qry = '{}' THEN "true" ELSE "false" END),',"msg":',@qry,',"token":"',@token,'"}') AS RES;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_borrarGen` (`_id` VARCHAR(10), `_tip` INT)  BEGIN
	#CREATE PROCEDURE sp_borrarGen(_id VARCHAR(10), _tip INT)
    IF _tip=1 THEN #ARTICULOS
    	UPDATE inv_art_u 
			SET est='C' 
        WHERE id_art=_id;
        
        UPDATE inv_lote_u 
			SET act=0
        WHERE id_art=_id;
        
         SET @catego=IFNULL((
			   SELECT CONCAT('[',
						GROUP_CONCAT(
							JSON_OBJECT('id',id_tipo,'nom',nom,'descr',descr)
						),']')    
				FROM inv_tipo_u
				WHERE act=1
				order by id_tipo
		),'[]')
		;
		   
		SET @merca=IFNULL((
			select GROUP_CONCAT(CONCAT(
				'{"id":"',ta.id_art,'","nom":"',ta.descr,'","uni":"',ta.uni,'","costo":',ta.costo
				,',"id_tipo":',tc.id_tipo,',"foto1":"',ta.foto,'","marcas":"',ifnull(td.nom,'')
				,'","cant":',ifnull(tb.cant,0),',"capacidad":',ta.capacidad,',"uni_cap":"',ifnull(ta.uni_cap,'pz'),'"}'
				)) res
			from(	
				SELECT id_art,descr,uni,id_tipo,alt,prof,anc,peso,costo,baterias,conex_elect,obs,ifnull(foto1,'') as foto
					  ,capacidad,uni_cap,modelo,renta,tiempo_renta,cal_gasto
				FROM inv_art_u 
				WHERE est='A'
				#limit 3627
				#limit 3496
				#limit 2759 # and id_art='A001780' 
			) as ta
			left join(
				SELECT id_art,max(id_marca) as id_marc,sum(cant) as cant ,max(ifnull(id_aloj,''))as id_aloj
				from(
					SELECT id_lote,id_art,id_marca,id_doc,(case when(mas_menos=0) then cant*-1 else cant end) as cant
					FROM  inv_lote_u 
					#where  id_art='A001806'
				) as t1
				left join(
					SELECT id_doc,tipo,id_aloj
					FROM  inv_vals_c 
					where est='A' 
				)as t2
				 on t1.id_doc=t2.id_doc     
				 WHERE ifnull(id_aloj,'')='AL000001' or ifnull(id_aloj,'')='' or ifnull(id_aloj,'')='AL000010'
				group by id_art
			 ) as tb
			 on ta.id_art=tb.id_art
			 left join( select * from inv_tipo_u )as tc
			 on ta.id_tipo=tc.id_tipo
			 left join( SELECT id_marc,nom,act FROM inv_marc_u )as td
			 on tb.id_marc=td.id_marc
		),'')
		;
		
		SELECT CONCAT('{"error":false,"view":{"ok":true,"msg":""},"catego":',@catego,',"arts":[',@merca,']}') AS RES;
    ELSEIF _tip=2 THEN  #VALES
        UPDATE inv_vals_c 
			SET est='C' 
        WHERE id_doc=_id;
        
        UPDATE inv_lote_u 
			SET act=0
        WHERE id_doc=_id;
        
        SELECT  CONCAT('{"error":false,"msg":"Se Borro el Vale ', _id,'"}') AS RES;
    ELSE 
		SELECT  CONCAT('{"error":true,"msg":"Opción ',_tip,' no encontrada para', _id,'"}') AS RES;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_crudPers` (`_obj` JSON)  BEGIN
	SET @tip=REPLACE(JSON_EXTRACT(_obj, '$.tip'),'"','');
    SET @email=REPLACE(JSON_EXTRACT(_obj, '$.email'),'"','');
    SET @nom=REPLACE(JSON_EXTRACT(_obj, '$.nom'),'"','');
    SET @est=REPLACE(JSON_EXTRACT(_obj, '$.est'),'"','');
    SET @usu=REPLACE(JSON_EXTRACT(_obj, '$.usu'),'"','');
    SET @pass=REPLACE(JSON_EXTRACT(_obj, '$.pass'),'"','');
    
    SET @ok=true;
    SET @msg='';
    SET @lista='[]';
    SET @id_per=777;
	IF @tip='C' THEN
	   SET @existe=(select EXISTS((SELECT * FROM sop_per_u WHERE email=@email)));
       IF @existe=0 THEN
			set @nrow=(SELECT COUNT(*) FROM sop_per_u);
            IF @nrow<13 THEN
				set @id_per=( select max(id_per) FROM sop_per_u where estado =1 group by estado )+1;
				select @id_per,@email,@nom,@usu,1,fn_crearKey(@pass),NOW(),@est
				;
            ELSE
				SET @msg='"Limete de usuarios';
            END IF;
       ELSE 
		   SET @ok=false;	
		   SET @msg=CONCAT('"correo ya registrado ',@email,'"');
	   END IF;
    ELSEIF @tip='R' THEN
	   SET @id_per=REPLACE(JSON_EXTRACT(_obj, '$.id'),'"','');
    ELSEIF @tip='U' THEN
	   SET @id_per=REPLACE(JSON_EXTRACT(_obj, '$.id'),'"','');
       
	   IF @pass <> '123456' THEN
			SET @id_per=REPLACE(JSON_EXTRACT(_obj, '$.id'),'"','');
            SET @antPass=( select pass from sop_per_u where id_per=@id_per );
            
			IF fn_crearKey(@pass)<>@antPass THEN
				update sop_per_u 
					set pass=fn_crearKey(@pass)
                where id_per=@id_per;
                
                SET @msg=CONCAT('Nueva contraseña=>',@pass);
			END IF;
       END IF;
       
       update sop_per_u 
			set nom=@nom,email=@email,id_user=@usu,estado=@est
       where id_per=@id_per;
       
   ELSEIF @tip='D' THEN
	  SET @id_per=REPLACE(JSON_EXTRACT(_obj, '$.id'),'"','');	
	  DELETE from sop_per_u where id_per=@id_per;
      
      SET @msg=CONCAT('Se borro usuario con id=>',@id_per);
   ELSE 
	   SELECT @tip;
	END IF;
    
    IF @ok THEN
		SET @lista=ifnull((
				SELECT CONCAT('[', 
						GROUP_CONCAT(CONCAT('{"id":',id_per,',"nom":"',nom,'","estado":',estado
											,',"email":"',email,'","apps":',apps,',"permisos":',permisos
											,',"reg":"',registro,'"}')),
						']')
				FROM(
					SELECT  id_per,email,nom,registro,estado
							,IFNULL((SELECT CONCAT('[', 
										GROUP_CONCAT(CONCAT('{"id":',TA.id_app,',"nom":"',TA.nom,'","des":"',TA.des,'","ver":"',TA.version,'","reg":"',TA.registro,'","act":',TA.act,'}')),
									']') as vecApp
								FROM (
									SELECT id_app,nom,des,version,registro,act 
									FROM sop_app_u
								) AS TA
								LEFT JOIN(
									SELECT id_per,id_app
									FROM sop_per_u
								) AS TB
								ON TA.id_app=TB.id_app
								WHERE TB.id_per=T1.id_per),'[]') AS apps
							,(SELECT CONCAT('[', 
									GROUP_CONCAT(CONCAT('{"id":',TA.id_usu,',"des":"',TA.descr,'","permisos":',TA.permisos,',"id_app":"',TA.id_app,'","act":',TA.act,'}')),
								  ']') as vecPermi
							FROM(
								SELECT id_usu,descr,permisos,id_app,act FROM sop_usu_u
							) AS TA    
							LEFT JOIN(
								SELECT id_per,id_user,id_app
								FROM sop_per_u
							) AS TB
							ON TA.id_usu=TB.id_user AND TA.id_app=TB.id_app
							WHERE TB.id_per=T1.id_per
							)as permisos    
					FROM(
						SELECT id_per,MAX(email) email,MAX(nom) nom,MIN(registro) AS registro,MAX(estado) AS estado   
						FROM sop_per_u
						GROUP BY id_per
					) AS T1    
				 ) AS TZ
				 where 1=(CASE WHEN @tip='R'
								THEN  CASE WHEN @id_per=777
										THEN 1
										ELSE CASE WHEN @id_per=999
												THEN 0
												ELSE CASE WHEN id_per=@id_per
															THEN 1
															ELSE 0
														 END
											 END
									  END  
								ELSE 1
						   END)
		),'[]');
        #select @lista;
        
        SET @tips=ifnull((CONCAT('[',(
				SELECT GROUP_CONCAT('{"id":',id_usu,',"permisos":',permisos,',"descr":"',descr,'"}')
				FROM sop_usu_u
                where 1=(CASE WHEN @tip='R' THEN 1 ELSE 0 END)
         ),']')),'[]');
		 #select @tips;
    END IF;
    
    SELECT CONCAT('{"error":',(CASE WHEN @ok THEN 'false' ELSE 'true' END),',"msg":"',@msg,'","list":',@lista,',"tips":',@tips,'}') AS RES;	
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_crudPosArt` (`_id_aloj` VARCHAR(10), `_id_art` VARCHAR(10), `_pos` VARCHAR(20), `_tip` VARCHAR(2))  BEGIN
	#CREATE PROCEDURE sp_crudPosArt(_id_aloj VARCHAR(10),_id_art  VARCHAR(10),_pos  VARCHAR(20),_tip  VARCHAR(2))
	#SELECT _id_aloj,_id_art,_pos,_tip;
    IF _tip='S' THEN
        VALUES(_id_art,_id_aloj,_pos)
        ;
        
        SELECT  CONCAT('{"error":false,"msg":"Se guardo nueva posición del articulo ', _id_art,'"}') AS RES;
	ELSEIF _tip='D' THEN
		DELETE FROM inv_pos_u
        WHERE id_art=_id_art AND  id_aloj=_id_aloj
        ;
        SET @pos=IFNULL((
			SELECT CONCAT('[', 
				GROUP_CONCAT(JSON_OBJECT('id_art',id_art,'id_aloj',id_aloj,'pos',posicion)),
			']')
			FROM inv_pos_u
			WHERE id_art=_id_art
          ),'[]');   
          
        SELECT  CONCAT('{"error":false,"msg":"Se borro posición del articulo ', _id_art,'","vec":', @pos,'}') AS RES;
    ELSE
		SET @pos=IFNULL((
			SELECT CONCAT('[', 
				GROUP_CONCAT(JSON_OBJECT('id_art',id_art,'id_aloj',id_aloj,'pos',posicion)),
			']')
			FROM inv_pos_u
			WHERE id_art=_id_art
          ),'[]');   
                
        SELECT  CONCAT('{"error":false,"vec":', @pos,'}') AS RES;
    END IF;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_deleteVale` (`_obj` JSON)  BEGIN
/**/
	DECLARE EXIT HANDLER FOR SQLEXCEPTION   BEGIN  
        SELECT  CONCAT('{"error":true,"msg":"ERROR CONSULTA sp_deleteVale","info":',_obj,'}') AS RES;
	END;
/**/   
	SET SQL_SAFE_UPDATES = 0;
	SET @id_doc=REPLACE(JSON_EXTRACT(_obj, '$.id_doc'),'"','');
    
	DELETE FROM inv_lote_u where id_doc=@id_doc;
    DELETE from inv_vals_c where id_doc=@id_doc;
	DELETE from inv_vals_d where id_doc=@id_doc;
    
    SET @id_doc='';

	SET @tipo=(CASE WHEN (REPLACE(JSON_EXTRACT(_obj, '$.tipo'),'"','')='0') THEN ''
				   WHEN (REPLACE(JSON_EXTRACT(_obj, '$.tipo'),'"','')='1') THEN ' AND tipo=''S'' '
                   ELSE ' AND tipo=''E'' '
			  END);
              
    SET @id_sitio=(CASE WHEN (REPLACE(JSON_EXTRACT(_obj, '$.sitio'),'"','')='') THEN ''
				   ELSE CONCAT(' AND id_aloj=''',REPLACE(JSON_EXTRACT(_obj, '$.sitio'),'"',''),'''')
			  END);
    
    SET @buscar=(CASE WHEN (@id_doc='') 
				  THEN CONCAT('fecha BETWEEN CAST(''',REPLACE(JSON_EXTRACT(_obj, '$.ini'),'"',''),''' AS DATE) 
							AND CAST(''',REPLACE(JSON_EXTRACT(_obj, '$.fin'),'"',''),''' AS DATE) ',@tipo,' ',@id_sitio,' AND T1.est=''A''')
				  ELSE CONCAT('CAST(REPLACE(T1.id_doc,''VA'','''') AS UNSIGNED)=CAST(REPLACE(''',@id_doc,''',''VA'','''') AS UNSIGNED)')
			  END);
              
   # SELECT @buscar;
    SET @s = CONCAT('
	SELECT CONCAT(''{"error":false,"actio":{"ok":true,"msg":""},"vales":''
    ,(
    IFNULL((	
	   SELECT CONCAT(''['',
				GROUP_CONCAT(JSON_OBJECT(''id_doc'',TA.id_doc,''id_sitio'',TA.id_aloj,''obser'',TA.obser
					,''fecha'',TA.fecha,''tipo'',TA.tipo,''est'',TA.est,''num'',CAST(TA.num AS CHAR(15))
					,''id_aloj2'',TA.id_aloj2,''sitio'',TB.nom,''descr_sit'',TB.descr
					,''encargado'',TD.nom,''cargo'',TD.cargo)),
			'']'')   
        FROM(
			SELECT id_doc,tipo,fecha,est,obser
				  ,(CASE WHEN tipo=''S'' THEN id_aloj ELSE id_aloj2 END) AS id_aloj 	
                  ,(CASE WHEN tipo=''S'' THEN id_aloj1 ELSE id_aloj END) AS id_aloj2
				  ,(SELECT COUNT(part)
					FROM( SELECT id_doc,id_art,part FROM inv_vals_d ) AS TA
					LEFT JOIN( SELECT id_art,est FROM inv_art_u WHERE est=''A'' )AS TB
					ON TA.id_art=TB.id_art
					WHERE  TA.id_doc=T1.id_doc 
                    AND 1=(CASE WHEN ( IFNULL(TB.id_art,'''')='''' ) THEN 0 ELSE 1 END)
					GROUP BY TA.id_doc) as num
			FROM inv_vals_c AS T1
            WHERE ',@buscar,'
        ) AS TA
        LEFT JOIN(
			SELECT id_aloj,nom,descr
            FROM inv_aloj_c
        ) AS TB
        on (CASE WHEN TA.tipo=''S'' THEN TA.id_aloj ELSE TA.id_aloj2 END)=TB.id_aloj
        LEFT JOIN(
			SELECT id_aloj,id_per,obser,fecha_fin
            FROM inv_aloj_d
            WHERE IFNULL(fecha_fin,''1'')=''1''
        ) AS TC
        on TA.id_aloj=TC.id_aloj
        LEFT JOIN(
			SELECT id_per,nom,cargo
            FROM inv_per_u
        ) AS TD
        on TC.id_per=TD.id_per),''[]'')),''}'') AS RES; 
       ');
    #SELECT @s;
  
    PREPARE stmt FROM @s;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
/**/

END$$

