CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_editSaveKit` (`_tip` INT, `_id_kit` INT, `_vec` JSON)  BEGIN
  #CREATE PROCEDURE sp_editSaveKit (_tip INT, _id_kit INT, _vec JSON)
  SET @id_kit= CASE WHEN  _id_kit=0
					THEN  (SELECT folio FROM inv_control_u where nom_tab='inv_kits_u')+1
                    ELSE _id_kit
               END;     
   IF _tip=2 THEN
		UPDATE inv_kits_u
			SET estado=0
		 WHERE id_kit=@id_kit;
   ELSE 
	   DELETE FROM inv_kits_u WHERE id_kit=@id_kit;   
	   SET @cont2=0;
	   WHILE @cont2<JSON_LENGTH(_vec)  DO
			VALUES( @id_kit,REPLACE(JSON_EXTRACT(_vec ,concat('$[',CAST(@cont2 AS CHAR(15)),'].id_art')),'"','')
				  ,	'','',1
				  ,REPLACE(JSON_EXTRACT(_vec ,concat('$[',CAST(@cont2 AS CHAR(15)),'].part')),'"',''));
			  
			SET @cont2 = @cont2 +1;     
	   END WHILE;
	   
	   IF _tip=0 THEN
		 UPDATE inv_control_u
			SET folio=(folio+1)
		 WHERE nom_tab='inv_kits_u';
	   END IF;
   END IF;
  
   SET @arts=IFNULL((
		SELECT CONCAT('[',GROUP_CONCAT(JSON_OBJECT('id_kit',T1.id_kit,'id_art',T1.id_art,'relacion',T1.relacion
			,'obs',T1.obs,'part',T1.parte,'descr',T2.descr,'id_tipo',T2.id_tipo,'tipo',T4.nom
			,'capacidad',T2.capacidad,'uni',T2.uni_cap,'modelo',T2.modelo,'id_marc',T5.id_marc
			,'marca',T5.nom)),']')
		FROM(
			SELECT id_kit,id_art,relacion,obs,parte
			FROM inv_kits_u
			WHERE estado=1
		)AS T1
		LEFT JOIN( SELECT id_art,descr,id_tipo,capacidad,uni_cap,modelo From inv_art_u  where est='A' )AS T2
		ON T1.id_art=T2.id_art
		LEFT JOIN(	SELECT id_art,max(id_marca) as id_marca  From inv_lote_u group by id_art )AS T3
		ON T1.id_art=T3.id_art
		LEFT JOIN(	SELECT id_tipo, nom  From inv_tipo_u  where act=1  )AS T4
		ON T2.id_tipo=T4.id_tipo
		LEFT JOIN(	SELECT id_marc,nom  From inv_marc_u  )AS T5
		ON T3.id_marca=T5.id_marc
        order by id_kit
        ),'[]')
     ;
     
     SET @kits=IFNULL((
		select GROUP_CONCAT(id_kit)
        from(
			select id_kit
			from inv_kits_u
			where estado=1
			group by id_kit
        )  as t1    
      ),'')
     ;  
     
    SELECT CONCAT('{"error":false,"kits":[', @kits,'],"arts":', @arts,'}') AS RES;

END$$

