    ),'{}')
    ;
    
    SET @id_k=(SELECT ifnull(GROUP_CONCAT(id_kit),'') FROM inv_kits_u  where estado=1 and id_art=_id_a );

	SET @kits='[]';	
    IF @id_k!='' THEN
		SET @kits=IFNULL((
			 SELECT CONCAT('[',GROUP_CONCAT(
				CONCAT('{"id":"',id_art,'","nom":"',descr
					,'","kits":"',kits,'","uni_cap":"',ifnull(uni_cap,'pz'),'","capacidad":',capacidad
					,',"precio":',costo,',"posicion":"',posicion,'","catego":"',nom,'","marcas":"',marcas,'"}')
				),']')     
