CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getInfoArtCatMar` ()  BEGIN
	#CREATE PROCEDURE sp_getInfoArtCatMar ()
    /**/
	DECLARE EXIT HANDLER FOR SQLEXCEPTION   BEGIN  
        SELECT  CONCAT('{"error":true,"msg":"ERROR CONSULTA sp_getInfoArtCatMar","info":""}') AS RES;
	END;
    /**/
    #SET @arts='';
    SET @arts=IFNULL((
     SELECT CONCAT('[',GROUP_CONCAT(
		CONCAT('{"id":"',id_art,'","nom":"',descr
			,'","label":"',CONCAT('(',id_art,') ',descr),'","value":"',id_art
            ,'","kits":"',kits,'","uni_cap":"',ifnull(uni_cap,'pz'),'","capacidad":',capacidad
            ,',"precio":',costo,',"posicion":"',posicion,'","catego":"',nom,'","marcas":"',marcas,'"}')
        ),']')     
	/*SELECT id_art,descr,uni,img_codebar,CONCAT('(',id_art,') ',descr),id_art
		,uni_cap,capacidad,nom,IFNULL(foto1,''),marcas,kits*/
    FROM(        
		SELECT TA.id_art,descr,uni,foto1,TA.id_tipo,TB.nom,IFNULL(img_codebar,'') AS img_codebar
			   ,uni_cap,capacidad,costo,'' posicion
			   ,IFNULL((SELECT GROUP_CONCAT(nom) 
					FROM(SELECT MAX(id_lote) id_lote,id_art,id_marca,MAX(id_doc) id_doc
							,MAX(obs) obs,MAX(act) act,SUM(cant) cant
