					  THEN REPLACE(JSON_EXTRACT(_head  , '$.sitio1'),'"','')
					  ELSE REPLACE(JSON_EXTRACT(_head  , '$.sitio2'),'"','')
				END);
                
    SET @tipo=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
					  THEN 'S'
					  ELSE 'E'
				END);
