    SET @id_aloj1=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
					  THEN REPLACE(JSON_EXTRACT(_head  , '$.sitio2'),'"','')
					  ELSE ''
				END);
    SET @id_aloj2=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
					  THEN ''
					  ELSE REPLACE(JSON_EXTRACT(_head  , '$.sitio1'),'"','')
				END);            
    
    VALUES(@id,@id_aloj,@tipo,NOW(),'A',@id_aloj1,@id_aloj2,@obs);
    #SELECT @id,@id_aloj,@tipo,NOW(),'A',@id_aloj1,@id_aloj2,'';
    
    #SET @lim=JSON_LENGTH(_detalle);
