        IF (@pos!='') THEN
            values(@id_art,(CASE WHEN @id_aloj1='' THEN @id_aloj ELSE @id_aloj1 END),@pos,@id)
            ;
        END IF;
        
        UPDATE inv_art_u
			set costo=REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].precio')),'"','')
        where  id_art=@id_art;
                
		VALUES(@id,(@cont2+1),@id_art,
