	UPDATE inv_control_u SET folio=(folio+1) WHERE nom_tab='inv_vals_c'
    and serie=(CASE WHEN(REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida') 
												THEN 'VS'
                                                ELSE 'VE'
                                           END) ;
    
    SET @doble=REPLACE(JSON_EXTRACT(_head  , '$.doble'),'"','');
    IF (@doble=1) THEN
		SELECT serie,CAST((folio+1) AS CHAR(10)) INTO serie_,folio_
		FROM inv_control_u 
		WHERE nom_tab='inv_vals_c' and serie=(CASE WHEN(REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida') 
												THEN 'VE'
                                                ELSE 'VS'
                                           END) ;

		SET @cont=CHAR_LENGTH(folio_);
		WHILE @cont<6  DO
			SET folio_=CONCAT('0',folio_);
			SET @cont = @cont +1;
		END WHILE;
		SET @id=CONCAT(serie_,folio_);
			
		SET @id_aloj=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
						  THEN REPLACE(JSON_EXTRACT(_head  , '$.sitio2'),'"','')
						  ELSE REPLACE(JSON_EXTRACT(_head  , '$.sitio1'),'"','')
					END);
					
		SET @tipo=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
						  THEN 'E'
						  ELSE 'S'
					END);
		SET @obs=REPLACE(JSON_EXTRACT(_head  , '$.obs'),'"','');
		
		SET @id_aloj1=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
						  THEN ''
						  ELSE REPLACE(JSON_EXTRACT(_head  , '$.sitio2'),'"','')
					END);
		SET @id_aloj2=(CASE WHEN REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida'
						  THEN REPLACE(JSON_EXTRACT(_head  , '$.sitio1'),'"','')
						  ELSE ''
					END);            
		
		VALUES(@id,@id_aloj,@tipo,NOW(),'A',@id_aloj1,@id_aloj2,@obs);
		#SELECT @id,@id_aloj,@tipo,NOW(),'A',@id_aloj1,@id_aloj2,'';
		
		#SET @lim=JSON_LENGTH(_detalle);
		SET @cont2=0;
		
		SET @fl_l=(SELECT (folio+1) FROM inv_control_u WHERE nom_tab='inv_lote_u');	/*REVISAR SI SOLO UNA VES NUMERO LOTE*/
		WHILE @cont2<JSON_LENGTH(_detalle)  DO
			#SET @fl_l=(SELECT (folio+1) FROM inv_control_u WHERE nom_tab='inv_lote_u');/*REVISAR SI CADA ARTICULO SU LOTE*/
			 
			VALUES(@id,(@cont2+1)
					,REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].id')),'"',''),
					@fl_l,JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].cant'))
					,REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].obs')),'"',''));
			/*SELECT @id,(@cont2+1),REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].id')),'"',''),
					@fl_l,JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].cant')),'';
			*/
			SET @id_marc=(SELECT id_marc
						  FROM inv_marc_u
						  WHERE nom=REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].marcas')),'"',''));        
							
			VALUES(@fl_l,REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].id')),'"','')
				  ,@id_marc,@id,REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].obs')),'"','')
				  ,1,JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].cant'))
				  ,(CASE WHEN @tipo='S'  THEN 0  ELSE 1	END),str_to_date(REPLACE(JSON_EXTRACT(_head  , '$.fech'),'"',''), '%Y-%m-%d')
			);       
			/*SELECT @fl_l,REPLACE(JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].id')),'"','')
				  ,@id_marc,@id,'',1,JSON_EXTRACT(_detalle ,concat('$[',CAST(@cont2 AS CHAR(15)),'].cant'));
			*/
			 UPDATE inv_control_u SET folio=(folio+1) WHERE nom_tab='inv_lote_u';      
			
			SET @cont2 = @cont2 +1;
		END WHILE;
		
		UPDATE inv_control_u SET folio=(folio+1) WHERE nom_tab='inv_vals_c'
				 and serie=(CASE WHEN(REPLACE(JSON_EXTRACT(_head  , '$.tipo'),'"','')='Salida') 
												THEN 'VE'
                                                ELSE 'VS'
                                           END);
		
    END IF;
    
    SET @vales=IFNULL((	
	   SELECT CONCAT('[',
				GROUP_CONCAT(JSON_OBJECT('id_doc',TA.id_doc,'id_sitio',TA.id_aloj,'obser',TA.obser
					,'fecha',TA.fecha,'tipo',TA.tipo,'est',TA.est,'num',CAST(TA.num AS CHAR(15))
					,'id_aloj2',TA.id_aloj2,'sitio',TB.nom,'descr_sit',TB.descr
					,'encargado',TD.nom,'cargo',TD.cargo)),
			']')
        FROM(
			SELECT id_doc,id_aloj,tipo,fecha,est,obser
                  ,(CASE WHEN id_aloj1='' THEN id_aloj2 ELSE id_aloj1 END) AS id_aloj2
				  ,(SELECT COUNT(part)
					FROM( SELECT id_doc,id_art,part FROM inv_vals_d ) AS TA
					LEFT JOIN( SELECT id_art,est FROM inv_art_u WHERE est='A' )AS TB
					ON TA.id_art=TB.id_art
					WHERE TA.id_doc=T1.id_doc
                    AND 1=(CASE WHEN ( IFNULL(TB.id_art,'')='' ) THEN 0 ELSE 1 END)
					GROUP BY TA.id_doc) as num
			FROM inv_vals_c AS T1
            WHERE fecha BETWEEN date_add(NOW(), INTERVAL -5 DAY)  AND NOW()
            AND est='A'
        ) AS TA
        LEFT JOIN(
			SELECT id_aloj,nom,descr
            FROM inv_aloj_c
        ) AS TB
        on TA.id_aloj=TB.id_aloj
        LEFT JOIN(
			SELECT id_aloj,id_per,obser,fecha_fin
            FROM inv_aloj_d
            WHERE IFNULL(fecha_fin,'1')='1'
        ) AS TC
        on TA.id_aloj=TC.id_aloj
        LEFT JOIN(
			SELECT id_per,nom,cargo
            FROM inv_per_u
        ) AS TD
        on TC.id_per=TD.id_per),'[]');
    
	SELECT CONCAT('{"error":false,"actio":{"ok":true,"msg":""},"vales":',@vales,'}') AS RES;	
     
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte1` (`_id_sit` VARCHAR(10))  BEGIN
#CREATE PROCEDURE sp_reporte1(_id_sit VARCHAR(10))
/**/
	DECLARE EXIT HANDLER FOR SQLEXCEPTION   BEGIN  
        SELECT  CONCAT('{"error":true,"msg":"ERROR CONSULTA sp_reporte1","info":{"id_sit":"',_id_sit,'"}}') AS RES;
	END;
/**/    
    SET @repor=IFNULL((	
		SELECT GROUP_CONCAT(
			CONCAT('{"id_art":"',ta.id_art,'","descr":"',tb.descr
				 ,'","tipo":"',tc.nom,'","capacidad":',tb.capacidad,',"uni_cap":"',tb.uni_cap
                 ,'","modelo":"',tb.modelo,'","marca":"',td.nom,'","cant01":',ta.cant
                 ,',"cant02":',0,'}')
            )
		#SELECT ta.id_art,ta.id_marca,ta.cant,tc.nom,td.nom,tb.descr,tb.id_tipo,tb.capacidad,tb.uni_cap,tb.modelo
		from(
			select id_art,max(id_marca) as id_marca,sum(cant) as cant
			from(
				select id_art,id_marca,tipo,t1.id_doc,id_aloj,id_aloj1,id_aloj2
					,(case when (tipo='S')
							then  case when (id_aloj=_id_sit)
										then (cant*-1)
										else 0 
								  end 
							else  case when (id_aloj=_id_sit)
										then cant
										else 0
								  end 
						end ) as cant
				from(
					SELECT id_doc,id_aloj,id_aloj1,id_aloj2,tipo,est
					FROM  inv_vals_c 
					WHERE est='A' 
					AND id_aloj=_id_sit
					#AND (id_aloj='AL000001' or id_aloj1='AL000001'  or id_aloj2='AL000001')
				) as t1
				left join(
					SELECT id_lote,id_art,id_marca,id_doc,cant,mas_menos
					FROM  inv_lote_u 
				)as t2
				on t1.id_doc=t2.id_doc    
			) as t1
			#WHERE id_art=@id_art
			group by id_art    
		 ) as ta
		 left join(
			select id_art,descr,id_tipo,capacidad,uni_cap,modelo
			from  inv_art_u
			where est='A'
		 )as tb
		 on ta.id_art=tb.id_art
		 left join( select * from inv_tipo_u)as tc on tb.id_tipo=tc.id_tipo
		 left join( select * from inv_marc_u)as td on ta.id_marca=td.id_marc
         where ta.cant<>0
	  #),'[]')   
      ),'')   
	;
    SET @sitio =ifnull(
		(select nom
		from inv_aloj_c
		WHERE est='A' AND id_aloj=_id_sit
		),'')
    ;
    
   
    SELECT CONCAT('{"error":false,"actio":{"ok":true,"msg":""},"repor":[',@repor,'],"sitio":"',@sitio,'"}') AS RES;	
	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte2` (`_id_per` VARCHAR(10))  BEGIN
	#CREATE PROCEDURE sp_reporte2 (_id_per VARCHAR(10))
	/*
	DECLARE EXIT HANDLER FOR SQLEXCEPTION   BEGIN  
        SELECT  CONCAT('{"error":true,"msg":"ERROR CONSULTA sp_reporte1","info":{"id_sit":"',_id_per,'"}}') AS RES;
	END;
	*/
    
    SET @repor=IFNULL((	
	   SELECT CONCAT('[',
			GROUP_CONCAT(JSON_OBJECT('id_aloj',T1.id_aloj,'id_per',T1.id_per,'fecha',T2.fecha
					,'par',T3.par,'tipo',T2.tipo,'id_doc',T2.id_doc,'nom',T4.nom
					)),
			']')
		FROM(
			SELECT id_aloj,id_per,fecha_ini AS ini,IFNULL(fecha_fin,NOW()) AS fin
			FROM inv_aloj_d
			WHERE id_per=_id_per
		) AS T1
		LEFT JOIN(
			SELECT id_doc,fecha,tipo,id_aloj1 AS id_aloj
			FROM inv_vals_c
			WHERE tipo='S'
			UNION
			SELECT id_doc,fecha,tipo,id_aloj2 AS id_aloj
			FROM inv_vals_c
			WHERE tipo='E'
		)AS T2
		ON T2.fecha BETWEEN T1.ini AND T1.fin AND T1.id_aloj=T2.id_aloj
		LEFT JOIN(
			SELECT id_doc,COUNT(*) AS par
			FROM inv_vals_d
			GROUP BY id_doc 
		)AS T3
		ON T2.id_doc=T3.id_doc
        LEFT JOIN(
			SELECT id_aloj,nom,descr
			FROM inv_aloj_c
		)AS T4
		ON T1.id_aloj=T4.id_aloj
    ),'[]')
    ;
    
	SELECT CONCAT('{"error":false,"actio":{"ok":true,"msg":""},"repor":',@repor,'}') AS RES;
    
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte3` ()  BEGIN
/**/
	DECLARE EXIT HANDLER FOR SQLEXCEPTION   BEGIN  
        SELECT  CONCAT('{"error":true,"msg":"ERROR CONSULTA sp_reporte3","info":{}}') AS RES;
	END;
/**/  
  SET @repor=IFNULL((	
		SELECT GROUP_CONCAT(
			concat('{"id":"',TA.id_art,'","nom":"',TA.descr,'","idTipo":"',TA.id_tipo,'","cap":',TA.capacidad
				 ,',"uni":"',TA.uni_cap,'","precio":',TA.costo,',"idMarc":"',TB.id_marc,'","marca":"',TB.marca
				 ,'","categoria":"',TC.nom,'"}')
            )     
		FROM(
			select id_art,descr,id_tipo,capacidad,uni_cap,costo
			from inv_art_u
			where est='A'
		) AS TA
		LEFT JOIN(
			select id_art,id_marc,nom as marca
			from(
				select id_art,max(id_marca) as id_mar
				from inv_lote_u
				group by id_art
				order by id_art
			 ) as T1
			 LEFT JOIN(
				SELECT id_marc,nom
				FROM inv_marc_u
			 )AS T2
			ON T1.id_mar=T2.id_marc
		) AS TB
		ON TA.id_art=TB.id_art
		LEFT JOIN(
			SELECT id_tipo,nom
			FROM inv_tipo_u
		)AS TC
		ON TA.id_tipo=TC.id_tipo
         ),'')   
	;
    
	SELECT CONCAT('{"error":false,"actio":{"ok":true,"msg":""},"precios":[',@repor,']}') AS RES;	
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_reporte4` (`_obj` JSON)  BEGIN
	
    SELECT
		CONCAT('[',ifnull(
			GROUP_CONCAT(
             ifnull(JSON_OBJECT('id_t',id_tipo,'catego',nom,'art',concat('(',id_art,')',descr),
             'f1',f1,'f2',f2,'cant',cant,'capa',capacidad,'uni',uni_cap,'preci',ifnull(costo,0),
             'tim_rent',tiempo_renta,'gasto',cal_gasto,'renta',renta
             ),'')
           ) ,'')
         ,']' ) as RES
    FROM(
		SELECT T4.id_tipo,T4.nom,T2.id_art,T3.descr,T1.fecha
			  #,T1.tipo,T1.fecha,T2.part
			  ,(CASE WHEN(T1.tipo='E') THEN T1.fecha ELSE '' END) as f1	
			  ,(CASE WHEN(T1.tipo='S') THEN T1.fecha ELSE '' END) as f2	
			  ,(CASE WHEN(T1.tipo='S') THEN 0 ELSE T2.cant END) as cant	
			  ,T3.capacidad,T3.uni_cap,T3.costo,T3.tiempo_renta,T3.cal_gasto,T3.renta
		FROM(
			SELECT id_doc,id_aloj,tipo,fecha
			FROM inv_vals_c
			WHERE id_aloj=REPLACE(JSON_EXTRACT(_obj  , '$.id_s'),'"','')
			AND fecha between DATE(REPLACE(JSON_EXTRACT(_obj  , '$.ini'),'"',''))
			AND DATE(REPLACE(JSON_EXTRACT(_obj  , '$.fin'),'"',''))
		) AS T1
		LEFT JOIN(
			SELECT id_doc,part,id_art,cant
			FROM inv_vals_d
		)AS T2
		ON T1.id_doc = T2.id_doc
		LEFT JOIN(
			SELECT id_art,descr,id_tipo,costo,capacidad,uni_cap,renta,tiempo_renta,cal_gasto
			FROM inv_art_u
			WHERE est='A'
		)AS T3
		ON T2.id_art = T3.id_art
		LEFT JOIN(
			SELECT id_tipo,nom
			FROM inv_tipo_u
		)AS T4
		ON T3.id_tipo= T4.id_tipo
	)  AS TA   
    WHERE 0!=IFNULL(id_tipo,0)
    order by fecha
    
    /*
    LEFT JOIN(
		
    )AS T2
    ON T1. = T2.
    */
    ;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updatePrecios` (`_vec` JSON)  BEGIN
	SET @cont2=0;
	WHILE @cont2<JSON_LENGTH(_vec)  DO
		set @txt1=(
			SELECT REPLACE(JSON_EXTRACT(_vec ,concat('$[',CAST(@cont2 AS CHAR(200)),'].Articulo')),'"','')
        );
        set @txt2=(
			REPLACE(JSON_EXTRACT(_vec ,concat('$[',CAST(@cont2 AS CHAR(19)),'].Precio')),'"','')
        );
        set @id=SUBSTRING(@txt1,POSITION("(" IN @txt1)+1,POSITION(")" IN @txt1)-2);
        set @costo=CONVERT(@txt2,decimal(10,2));
        #select @id,@costo_est;
        IF exists(SELECT * FROM inv_art_u where id_art=@id And est='A') THEN
		   update inv_art_u 
				set costo=@costo
           where id_art=@id And est='A';
           
           #SELECT * FROM inv_art_u where id_art=@id And est='A';
           
        END IF;
               
        SET @cont2 = @cont2 +1;    
    END WHILE;
        
    SET @catego=IFNULL((
		   SELECT CONCAT('[',
					GROUP_CONCAT(
						JSON_OBJECT('id',id_tipo,'nom',nom,'descr',descr)
                    ),']')    
			FROM inv_tipo_u
			WHERE act=1
			order by id_tipo
    ),'[]')
    ;
       
     SET @merca=IFNULL((
		select GROUP_CONCAT(CONCAT(
			'{"id":"',ta.id_art,'","nom":"',ta.descr,'","uni":"',ta.uni,'","costo":',ta.costo
			,',"id_tipo":',tc.id_tipo,',"foto1":"',ta.foto,'","marcas":"',ifnull(td.nom,'')
            ,'","cant":',ifnull(tb.cant,0),',"capacidad":',ta.capacidad,',"uni_cap":"',ifnull(ta.uni_cap,'pz'),'"}'
			)) res
		from(	
			SELECT id_art,descr,uni,id_tipo,alt,prof,anc,peso,costo,baterias,conex_elect,obs,ifnull(foto1,'') as foto
				  ,capacidad,uni_cap,modelo,renta,tiempo_renta,cal_gasto
			FROM inv_art_u 
			WHERE est='A'
            #limit 3627
            #limit 3496
            #limit 2759 # and id_art='A001780' 
		) as ta
		left join(
			SELECT id_art,max(id_marca) as id_marc,sum(cant) as cant ,max(ifnull(id_aloj,''))as id_aloj
			from(
				SELECT id_lote,id_art,id_marca,id_doc,(case when(mas_menos=0) then cant*-1 else cant end) as cant
				FROM  inv_lote_u 
				#where  id_art='A001806'
			) as t1
			left join(
				SELECT id_doc,tipo,id_aloj
				FROM  inv_vals_c 
				where est='A' 
			)as t2
			 on t1.id_doc=t2.id_doc     
			 WHERE ifnull(id_aloj,'')='AL000001' or ifnull(id_aloj,'')='' or ifnull(id_aloj,'')='AL000010'
			group by id_art
		 ) as tb
		 on ta.id_art=tb.id_art
		 left join( select * from inv_tipo_u )as tc
		 on ta.id_tipo=tc.id_tipo
		 left join( SELECT id_marc,nom,act FROM inv_marc_u )as td
		 on tb.id_marc=td.id_marc
	),'')
	;
    
    SELECT CONCAT('{"error":false,"insrt":{"ok":true,"msg":""},"catego":',@catego,',"arts":[',@merca,']}') AS RES;
         
END$$

