            FROM inv_art_u 
            WHERE est='A'
            
		) as ta
		left join(
			SELECT id_art,max(id_marca) as id_marc,sum(cant) as cant ,max(ifnull(id_aloj,''))as id_aloj
			from(
				SELECT id_lote,id_art,id_marca,id_doc,(case when(mas_menos=0) then cant*-1 else cant end) as cant
				FROM  inv_lote_u 
				#where  id_art='A001806'
			) as t1
			left join(
				SELECT id_doc,tipo,id_aloj
				FROM  inv_vals_c 
				where est='A' 
			)as t2
			 on t1.id_doc=t2.id_doc     
			 WHERE ifnull(id_aloj,'')='AL000001' or ifnull(id_aloj,'')=''  or ifnull(id_aloj,'')='AL000010'
			group by id_art
		 ) as tb
		 on ta.id_art=tb.id_art
		 left join( select * from inv_tipo_u )as tc
		 on ta.id_tipo=tc.id_tipo
		 left join( SELECT id_marc,nom,act FROM inv_marc_u )as td
		 on tb.id_marc=td.id_marc
         where  1=(CASE WHEN(_id=0)
							THEN 1
                            ELSE  CASE WHEN(ta.id_tipo=_id)
									   THEN 1
									   ELSE 0
								 END     
                       END)
    ),'')
	;
      
    SELECT CONCAT('{"error":false,"view":{"ok":true,"msg":""},"catego":',@catego,',"arts":[',@merca,']}') AS RES;
  
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_viewHistArt` (`_idArt` VARCHAR(15))  BEGIN
	#CREATE PROCEDURE sp_viewHistArt(_idArt VARCHAR(15))
    CREATE TEMPORARY TABLE tbl1(
		id_art VARCHAR(10), id_marca INT,id_doc VARCHAR(10)
        ,obs1 VARCHAR(1000),act TINYINT(4),cant DECIMAL(15,2)
        ,mas_menos TINYINT(4),tipo VARCHAR(2),fecha DATE,est VARCHAR(2)
        ,obser2 VARCHAR(50),id_aloj VARCHAR(10),nom VARCHAR(500)
        ,descr VARCHAR(900),id_aloj1 VARCHAR(10),nom1 VARCHAR(500)
        ,descr1 VARCHAR(900),id_aloj2 VARCHAR(10),nom2 VARCHAR(500)
        ,descr2 VARCHAR(900),obs3  VARCHAR(1000)
	);
    
					,fecha,est,obser2,id_aloj,nom,descr,id_aloj1,nom1,descr1
                    ,id_aloj2,nom2,descr2,obs3)
    SELECT T1.id_art,T1.id_marca,T1.id_doc,T1.obs,T1.act,T1.cant,T1.mas_menos
		   ,T2.tipo,T2.fecha,T2.est,T2.obser,T2.id_aloj,T2.nom,T2.descr
		   ,T2.id_aloj1,IFNULL(T2.nom1,''),IFNULL(T2.descr1,'')
           ,T2.id_aloj2,IFNULL(T2.nom2,''),IFNULL(T2.descr2	,''),T3.obs
    FROM(
		SELECT id_art,id_marca,id_doc,obs,act,cant,mas_menos
		FROM inv_lote_u
		WHERE id_art=_idArt and cant>0
    ) AS T1
    LEFT JOIN(
		SELECT TA.id_doc,TA.tipo,TA.fecha,TA.est,TA.obser
               ,TA.id_aloj,TB.nom AS nom,TB.descr  AS descr
			   ,TA.id_aloj1,TC.nom AS nom1,TC.descr  AS descr1
               ,TA.id_aloj2,TD.nom AS nom2,TD.descr  AS descr2
        FROM(
			SELECT id_doc,id_aloj,tipo,fecha,est,id_aloj1,id_aloj2,obser
			FROM inv_vals_c
        ) AS TA
        LEFT JOIN(
			SELECT id_aloj,nom,descr  FROM inv_aloj_c
        )AS TB
        ON TA.id_aloj=TB.id_aloj
        LEFT JOIN(
			SELECT id_aloj,nom,descr FROM inv_aloj_c
        )AS TC
        ON TA.id_aloj1=TC.id_aloj
        LEFT JOIN(
			SELECT id_aloj,nom,descr FROM inv_aloj_c
        )AS TD
        ON TA.id_aloj2=TD.id_aloj
    )AS T2
    on T1.id_doc=T2.id_doc
    LEFT JOIN(
		SELECT id_doc,id_art,cant,obs FROM inv_vals_d
    ) AS T3
    ON T1.id_doc=T3.id_doc AND T1.id_art=T3.id_art;
    
    SET @vales=IFNULL((
    SELECT CONCAT('[', 
			GROUP_CONCAT(JSON_OBJECT('id_art',id_art,'id_marca',id_marca,'id_doc',id_doc
				,'obs1',obs1,'act',act,'cant',cant,'mas_menos',mas_menos
				,'tipo',tipo,'fecha',fecha,'est',est,'obser2',obser2
				,'id_aloj',id_aloj,'nom',nom,'descr',descr,'id_aloj1',id_aloj1
				,'nom1',nom1,'descr1',descr1,'id_aloj2',id_aloj2,'nom2',nom2
				,'descr2',descr2,'obs3',obs3)),
			']')
    FROM tbl1
    ORDER BY fecha  DESC
    LIMIT 200
    ),'[]');
    
    SET @sitios=IFNULL((
		SELECT CONCAT('[', 
				GROUP_CONCAT(JSON_OBJECT('id_aloj',T1.id_aloj,'nom',T1.nom,'descr',T1.descr
				,'cantE',IFNULL(T2.cant,0),'cantS',IFNULL(T3.cant,0),'total',IFNULL(T2.cant,0)-IFNULL(T3.cant,0)
			   )),
			']')
		FROM(
			SELECT id_aloj,MAX(nom) as nom ,MAX(descr) as descr
			FROM tbl1
			GROUP BY id_aloj
		 ) AS T1   
		 LEFT JOIN(
			SELECT id_aloj,SUM(cant) as cant,'Entrada' AS tipo
			FROM tbl1
			WHERE tipo='E'
			GROUP BY id_aloj
		) AS T2
		ON T1.id_aloj=T2.id_aloj
		LEFT JOIN(
			SELECT id_aloj,SUM(cant) as cant,'Salida' AS tipo
			FROM tbl1
			WHERE tipo='S'
			GROUP BY id_aloj
		) AS T3
		ON T1.id_aloj=T3.id_aloj
    ),'[]');
    
    SELECT  CONCAT('{"sitios":', @sitios,',"vales":', @vales,'}') AS RES;
    
    DROP TEMPORARY TABLE tbl1;
END$$

