		FROM inv_aloj_c AS TF
		LEFT JOIN(
			SELECT TA.id_aloj,TA.obser,TA.fecha_ini,TA.fecha_fin
				  ,TB.id_per,TB.nom,TB.cargo,TB.telefono,TB.email
			FROM inv_aloj_d as TA
			LEFT join(
				SELECT id_per,nom,cargo,fecha_ini,fecha_fin,telefono,email
				FROM inv_per_u
			) AS TB
			ON TA.id_per=TB.id_per
			WHERE IFNULL(TA.fecha_fin,'1')='1'
		) AS TG
		ON TF.id_aloj=TG.id_aloj
   )AS T2
   ON T1.id_aloj=T2.id_aloj
   LEFT JOIN(
		SELECT TF.id_aloj,TF.nom,TF.descr,TF.fecha_ini,TF.fecha_fin,TF.est,TF.obser AS obs_a
			   ,TF.calle,TF.num_int,TF.num_ext,TF.colonia,TF.delegacion,TF.estado,TF.pais
               ,TF.cp,TF.tel
			   ,TG.obser AS obs_p,TG.fecha_ini AS fch_iniP,TG.fecha_fin  AS fch_finP
			   ,TG.id_per,TG.nom AS nom_p,TG.cargo,TG.telefono,TG.email
		FROM inv_aloj_c AS TF
		LEFT JOIN(
			SELECT TA.id_aloj,TA.obser,TA.fecha_ini,TA.fecha_fin
				  ,TB.id_per,TB.nom,TB.cargo,TB.telefono,TB.email
			FROM inv_aloj_d as TA
			LEFT join(
				SELECT id_per,nom,cargo,fecha_ini,fecha_fin,telefono,email
				FROM inv_per_u
			) AS TB
			ON TA.id_per=TB.id_per
			WHERE IFNULL(TA.fecha_fin,'1')='1'
		) AS TG
		ON TF.id_aloj=TG.id_aloj
   )AS T3
   ON T1.id_aloj2=T3.id_aloj
  )
  ;
  /**/
 #SELECT @detalle; 
SET @detalle=IFNULL((
	  SELECT
		CONCAT('[',GROUP_CONCAT(
            CONCAT('{"id_doc":"',T1.id_doc,'","part":',CAST(T1.part AS CHAR(10)),
			',"id":"',T1.id_art,'","cant":',CAST(T1.cant AS CHAR(10)),',"obs":"',T1.obs
			,'","marcas":"',IFNULL(T2.marca,''),'","cant2":',CAST(T2.cant2 AS CHAR(10))
            ,',"capacidad":',ifnull(CAST(T3.capacidad AS CHAR(15)),1),',"uni_cap":"',ifnull(T3.uni_cap,'pz')
            ,'","precio":',ifnull(costo,0),',"posicion":"',ifnull(T4.posicion,'')
			,'","nom":"',T3.descr,'","catego":"',T3.tipo,'"}')
            ),']')
	  FROM(
	    SELECT id_doc,part,id_art,id_lote,cant,obs   FROM inv_vals_d 
       #WHERE  CAST(REPLACE(id_doc,'VA','') AS UNSIGNED)=CAST(REPLACE(_idV,'VA','') AS UNSIGNED)
        WHERE id_doc=_idV
	  ) AS T1 
	  LEFT JOIN(
		SELECT id_doc,id_art,MAX(TB.nom) as marca,SUM(cant) AS cant2
		FROM( SELECT id_lote,id_art,id_marca,id_doc,obs,cant FROM inv_lote_u ) AS TA
		LEFT JOIN( SELECT id_marc,nom,obs,img FROM inv_marc_u )AS TB
		ON TA.id_marca=TB.id_marc
		GROUP BY id_doc,id_art
	  )AS T2
	  ON T1.id_doc=T2.id_doc AND T1.id_art=T2.id_art
	  LEFT JOIN(
		SELECT TZ.id_art,TZ.descr,TZ.id_tipo,TZ.uni,TW.nom as tipo,TZ.capacidad,TZ.uni_cap,TZ.costo
		FROM(
			SELECT  id_art,descr,id_tipo,id_cad,id_mant,uni,capacidad,uni_cap,costo
            FROM inv_art_u
            WHERE est='A'
		) AS TZ
		LEFT JOIN(
			SELECT id_tipo,nom,descr FROM inv_tipo_u
		)AS TW
		ON TZ.id_tipo=TW.id_tipo
	  )AS T3 ON T1.id_art=T3.id_art
      left join(
		SELECT  id_art,id_doc,posicion
        FROM inv_pos_u
      )as T4
      on T4.id_doc=T1.id_doc AND T4.id_art=T1.id_art
      WHERE 1=(CASE WHEN(IFNULL(T3.id_art,'')='') THEN 0 ELSE 1 END)
  ),'[]')
  ;

  
    
  SET @arts=IFNULL((
     SELECT CONCAT('[',
			GROUP_CONCAT(JSON_OBJECT('id',id_art,'nom',descr,'uni',uni
					,'label',CONCAT('(',id_art,') ',descr),'value',id_art,'obs',''
                    ,'kits',kits,'uni_cap',uni_cap,'capacidad',capacidad
					,'catego',nom,'marcas',marcas)),
			']')
	FROM(        
		SELECT TA.id_art,descr,uni,foto1,TA.id_tipo,TB.nom,IFNULL(img_codebar,'') AS img_codebar
			   ,uni_cap,capacidad
			   ,IFNULL((SELECT GROUP_CONCAT(nom) 
					FROM(SELECT MAX(id_lote) id_lote,id_art,id_marca,MAX(id_doc) id_doc
							,MAX(obs) obs,MAX(act) act,SUM(cant) cant
						FROM  inv_lote_u
                        GROUP BY id_art,id_marca
                    ) AS T1
					LEFT JOIN( SELECT * FROM inv_marc_u)AS T2
					on T1.id_marca=T2.id_marc WHERE T1.id_art=TA.id_art),'') AS marcas
                ,(SELECT ifnull(GROUP_CONCAT(id_kit),'') FROM inv_kits_u  where estado=1 and id_art=TA.id_art) as kits    
        FROM inv_art_u AS TA
        LEFT JOIN(
			SELECT id_tipo,nom,act
            FROM inv_tipo_u
            WHERE act=1
        )AS TB
        ON TA.id_tipo=TB.id_tipo
        where TA.est='A' 
        #and descr not LIKE '%Abrazadera%' and descr not LIKE '%Metecno%' and descr  LIKE '%Clavo%'
        limit 3400
    ) as TZ),'[]');
    
    SET @sitios=IFNULL((
    SELECT CONCAT('[',
			GROUP_CONCAT(JSON_OBJECT('id',id_aloj,'nom',nom
				,'value',CONCAT('(',id_aloj,') ',nom),'label',CONCAT('(',id_aloj,') ',nom))),
			']')
    FROM inv_aloj_c),'[]');
    /**/
  #SELECT @head,@detalle;	
  SET @vale=CONCAT('{"head":',@head,',"detalle":',@detalle,'}');	
  #SET @vale=CONCAT('{"head":',@head,',"detalle":',@detalle,'}');	
  #SELECT CONCAT('{"error":false,"actio":{"ok":true,"msg":""},"vale":',@vale,',"arts":',@arts,',"sitios":',@sitios,'}') AS RES;	
  SELECT CONCAT('{"error":false,"actio":{"ok":true,"msg":""},"vale":',@vale,',"arts":',@arts,',"sitios":',@sitios,'}') AS RES;	
  
END$$

